75112efe34108ce15b18b15fb124019883e1616c:
query GuildRuleSets($guildId: BigInt!) {
  guildRuleSets(condition: {guildId: $guildId}) {
    totalCount
    nodes {
      id
      guildId
      name
      author
      description
      category
      editable
      enabled
      createdAt
      updatedAt
      guildRulesBySetId {
        totalCount
        __typename
      }
      __typename
    }
    __typename
  }
}

10972029ece7cb031b881bb47b429f92d49db80e:
query GuildTags($guildId: BigInt!) {
  tags(condition: {guildId: $guildId}) {
    edges {
      node {
        content
        created
        tagName
        ownerId
        guildId
        useCount
        owner {
          id
          name
          discriminator
          avatarUrl
          __typename
        }
        __typename
      }
      cursor
      __typename
    }
    totalCount
    __typename
  }
}

7425b6ad89cb09fdf7f90027da1ee7a3d8d324b0:
query Leaderboard($timeframe: LevelTimeframe = ALL_TIME, $guildId: BigInt) {
  timeframeUserLevels(timeframe: $timeframe, guildId: $guildId, first: 50) {
    edges {
      node {
        username
        avatarUrl
        discriminator
        currentLevel
        nextLevelXpProgress
        nextLevelXpRequired
        userId
        xp
        xpDiff
        gainedLevels
        __typename
      }
      cursor
      __typename
    }
    totalCount
    __typename
  }
}

